import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import PublishMessage from "./PublishMessage";

function HomeStruct() {
  return (
    <Container>
      <Row>
        <Col></Col>
        <Col>
          <PublishMessage></PublishMessage>
        </Col>
        <Col>3 of 3</Col>
      </Row>
      <Row>
        <Col>1 of 2</Col>
        <Col>2 of 2</Col>
      </Row>
    </Container>
  );
}
